import React from 'react';
import styled from "styled-components";

const CardBlock = styled.div`
    display: flex;
    flex-wrap: wrap;
    justify-content: center;
    padding-left: 150px;
    padding-right: 150px;
    padding-top: 50px;
    padding-bottom: 50px;
    background-color: #F8F9FA;
`   

const CardEach = styled.div`
    background-color: white;
    margin:15px;
    border:1px solid white;
    border-radius: 6px;
    
`

const CardText = styled.p`
    font-size: 15px;
    text-align: left;
    margin-top: 20px;
    margin-bottom: 20px;
    margin-left: 21px;
    margin-right: 15px;
`

const Thumbnail = styled.div`
    background-color: #55595C;
    color: white;
    text-align: center;
    height: 240px;
    width: 340px;

`

const CardButton = styled.div`
    display: flex;
    flex-direction: row;
    margin-left: 21px;
    margin-bottom: 20px;
    border: 1px solid gray;
    border-radius: 7px;

`

const CardButton1 = styled.button`
    background-color: white;
    border: 1px solid gray;
    padding: 5px;
    font-size: 13px;
`

const CardButton2 = styled.button`
    background-color: white;
    border: 1px solid gray;
    padding: 5px;
    font-size: 13px;
    
`

const CardTime = styled.p`
    
`



const Card = () => {
    return (
        <CardBlock>
            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardUnder>
                    <CardButton>
                        <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> 
                    </CardButton>
                    <CardTime>9 mins</CardTime>
                </CardUnder>
                
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>

            <CardEach>
                <Thumbnail>Thumbnail</Thumbnail>
                <CardText>This is a wider card with supporting text<br/>below as a natural lead-in to additional<br/>content. This content is a little bit longer.</CardText>
                <CardButton>
                    <CardButton1>View</CardButton1> <CardButton2>Edit</CardButton2> <CardTime>9 mins</CardTime>
                </CardButton>
            </CardEach>
        </CardBlock>
    );
};

export default Card;
